let cards = [
    {img: "https://www.cahalpech.com/wp-content/uploads/Private-Local-Guides-Guided-Tours-in-Belize.jpg", name: "Jerry Sanfield", designation: "Tour Guide"},
    {img: "https://images.unsplash.com/photo-1603731569270-acf8458913f2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aW5kb25lc2lhbiUyMG1hbnxlbnwwfHwwfHw%3D&w=1000&q=80", name: "Minke", designation: "Local Resident"},
    {img: "https://images.unsplash.com/photo-1603731569270-acf8458913f2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aW5kb25lc2lhbiUyMG1hbnxlbnwwfHwwfHw%3D&w=1000&q=80", name: "Jimmy O Yang", designation: "Researcher"},
    {img: "https://images.unsplash.com/photo-1603731569270-acf8458913f2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aW5kb25lc2lhbiUyMG1hbnxlbnwwfHwwfHw%3D&w=1000&q=80", name: "Bo Bumham", designation: "Fotographer & Videographer"}
]


function Cards() {
    return(
        <div className="card_wrapper_5">
            {cards.map((cards) => 
                <div className="card_5">
                    <img src={cards.img} height="350" />
                    <div className="card_main_5">
                        <div className="card_header_5">{cards.name}</div>
                        <div className="card_text_5">{cards.designation}</div>
                    </div>
                </div>
            )}
        </div>
    )
}

export default Cards;
